package Selenium1;

import org.openqa.selenium.By;
import org.openqa.selenium.WebDriver;
import org.openqa.selenium.WebElement;
import org.openqa.selenium.chrome.ChromeDriver;

public class AssiDatePiker2 {

	public static void main(String[] args) throws InterruptedException {
		// TODO Auto-generated method stub
		
		WebDriver driver = new ChromeDriver();
		driver.manage().window().maximize();
		// step 3: open a url
		driver.get("https://www.makemytrip.com/");
		Thread.sleep(7000);
		//--------------from city---------------
		driver.findElement(By.id("fromCity")).click();
		driver.findElement(By.xpath("//input[@type='text']")).sendKeys("Pune");
		driver.findElement(By.id("react-autowhatever-1-section-0-item-0")).click();
		
		//-----------------`to city-------------------
		
		driver.findElement(By.id("toCity")).click();
		driver.findElement(By.xpath("//input[@type='text']")).sendKeys("Delhi");
		driver.findElement(By.id("react-autowhatever-1-section-0-item-0")).click();
		
		//------------------select 
         driver.findElement(By.className("lbl_input appendBottom10")).click();
         WebElement w2=driver.findElement(By.className("DayPicker-Caption"));
         String s=w2.getText();
         System.out.println(s);
         
	}

}
